import React, { Component } from 'react'
import CanvasJSReact from './canvasjs.react'
let CanvasJS = CanvasJSReact.CanvasJS;
let CanvasJSChart = CanvasJSReact.CanvasJSChart;

export default class Graph extends Component {
    state = {
      data: [],
      x_max: null,
      y_max: null
    }

    componentDidMount() {
      // filter out data that will not be graphed
      let graph = this.props.graph
      graph = graph.split(/(\s+)/).filter((value) => {
        return value.includes("e") && value.length > 6
      })
      graph.shift()
      // extract data that will be graphed
      let data_set = []
      let data_point = {}
      let counter = 0
      let nu_counter = 0
      let total_counter = 6
      let max_x = 0
      let max_y = 0
      graph.forEach((value) => {
        if(counter - nu_counter === 0) {
          nu_counter += 9
          data_point.x = Number(value)
        }
        if(counter - total_counter === 0) {
          total_counter += 9
          data_point.y = Number(value)
          data_set.push(data_point)
        }
        counter ++
      })
      this.setState({...this.state, data: data_set})
    }

    render() {
      const options = {
          theme: "dark2",
          animationEnabled: true,
          zoomEnabled: true,
          title:{
            text: "Ice Cream Sales vs Temperature"
          },
          axisX: {
            title:"Temperature (in °C)",
            minimum: 0,
		        maximum: 2260,
            suffix: "°C",
            crosshair: {
              enabled: true,
              snapToDataPoint: true
            }
          },
          axisY:{
            title: "Sales",
            minimum: 0,
		        maximum: 2260,
            includeZero: false,
            crosshair: {
              enabled: true,
              snapToDataPoint: true
            }
          },
          data: [{
            type: "scatter",
            markerSize: 15,
            toolTipContent: "<b>Temperature: </b>{x}°C<br/><b>Sales: </b>{y}",
            dataPoints: [
              { x: 14.2, y: 215},
              { x: 12.9, y: 175},
              { x: 16.4, y: 325},
              { x: 26.9, y: 635},
              { x: 32.5, y: 464},
              { x: 22.1, y: 522},
              { x: 19.4, y: 412},
              { x: 25.1, y: 614},
              { x: 34.9, y: 374},
              { x: 28.7, y: 625},
              { x: 23.4, y: 544},
              { x: 31.4, y: 502},
              { x: 40.8, y: 262},
              { x: 37.4, y: 312},
              { x: 42.3, y: 202},
              { x: 39.1, y: 302},
              { x: 17.2, y: 408}
            ]
          }]
        }
        console.log(this.state.data)
        return (
            <div >
            <CanvasJSChart options = {options}/>
            </div>
        )
    }
}
